import React from 'react';
import Highcharts, { destroyObjectProperties } from 'highcharts/highmaps';
import HighchartsReact from 'highcharts-react-official';
require('highcharts/modules/map')(Highcharts);

var data = [
    ['ae', 37],
    ['af', 44],
    ['am', 20],
    ['az', 19],
    ['bd', 9],
    ['bh', 12],
    ['bn', 43],
    ['bt', 26],
    ['cn', 70],
    ['cnm', 33],
    ['cy', 48],
    ['ge', 27],
    ['id', 65],
    ['il', 29],
    ['in', 65],
    ['iq', 36],
    ['ir', 70],
    ['jk', 40],
    ['jo', 31],
    ['jp', 100],
    ['kg', 52],
    ['kh', 25],
    ['kp', 45],
    ['kr', 70],
    ['kw', 35],
    ['kz', 28],
    ['la', 38],
    ['lb', 46],
    ['lk', 51],
    ['mm', 13],
    ['mn', 34],
    ['my', 18],
    ['nc', 47],
    ['np', 50],
    ['om', 5],
    ['ph', 1],
    ['pk', 39],
    ['qa', 41],
    ['ru', 70],
    ['sa', 2],
    ['sg', 65],
    ['sh', 17],
    ['sp', 10],
    ['sy', 30],
    ['th', 4],
    ['tj', 22],
    ['tl', 24],
    ['tm', 32],
    ['tr', 65],
    ['tw', 49],
    ['uz', 23],
    ['vn', 21],
    ['ye', 6]
  ];

  

class CoronoMap extends React.Component{

  constructor(props)
  {
    this.state={
      options : {
        chart:{   
            height:320,
        },
        mapNavigation: {
          enabled: true
      },
      title: {
        text: props.presentRegion+' Map'
      },
      credits:{
          enabled:false
      },
      
      series: [
        {
          mapData: Highcharts.maps["custom/asia"],
          name: 'Asia',
          data: []
        }
      ]
     }
    };

  }

    render(){
        return (
          <div className="col-xl-9 col-md-8">
              <div className="card" style={{marginBottom:'30px'}}>
                 <div className="card-body">
                    <HighchartsReact highcharts={Highcharts} options={this.state.options} constructorType={"mapChart"} />
                 </div>
              </div>
          </div>
        );
    }
}


export default CoronoMap;
